waves.point_eqs_eel:
n=sample*6.283;

flip=flip+1;
flip=flip*below(flip,2);

phase=sin(n*3)*sin(n*7.9)*sin(n*16.7)*sin(n*63.5)*6;

xp=sin(n+phase);
yp=cos(n+phase);
zp=0;

//rotate on y during draw
ang=n*2+phase;
xq=xp*sin(ang) + zp*cos(ang);
yq=yp;
zq=xp*cos(ang) - zp*sin(ang);

r1=0.1;g1=0.3;b1=1;
r2=0.7;g2=0.1;b2=1.0;
fade=xq*0.5 + 0.5;
r=r1*fade + r2*(1-fade);
g=g1*fade + g2*(1-fade);
b=b1*fade + b2*(1-fade);

//rotation;
ang=time*1;
xp=xq*sin(ang) + zq*cos(ang);
yp=yq;
zp=xq*cos(ang) - zq*sin(ang);

ang=time*0.17;
xq=xp;
yq=yp*sin(ang) + zp*cos(ang);
zq=yp*cos(ang) - zp*sin(ang);


//push into viewspace
zq=zq+4.1;


//project into screenspace
xs=xq/zq;
ys=yq/zq;


x=xs+0.5;
y=ys*1.3+0.5;
a=(1)*0.3 * (pow(sin(n*4+time)*0.8+0.,0));

spark=sin(phase*35);
r=if( above(spark,0.93) , 0.6 , r);
g=if( above(spark,0.93) , 0.8 , g);
b=if( above(spark,0.93) , 1.0 , b);

